import java.util.*;
public class FindAllAnagrams {

    public static void main(String[] args){
        String s = "";
        String p = "yqrbgjdwtcaxzsnifvhmou";
        findAnagrams(s,p);
    }

    public static boolean foundAnagram(String subpart,char [] p1){
        char [] subpart1=subpart.toCharArray();
        Arrays.sort(subpart1);
        if(Arrays.equals(subpart1,p1)){
            return true;
        }
        return false;
    }

    public static List<Integer> findAnagrams(String s, String p) {
        List<Integer> result=new ArrayList<>();
        if(p.length()>s.length()){
            return result;
        }
        String subPart="";
        char [] p1=p.toCharArray();
        int k=p.length();
        int i=0;
        for(;i<s.length()-k;i++){
            subPart=s.substring(i,i+k);
            if(foundAnagram(subPart,p1)){
                result.add(i);
                break;
            }
        }

        for(i=k;i<s.length();i++){
            subPart=s.substring(i-k+1,i+1);
            System.out.println(subPart);
            if(foundAnagram(subPart,p1)){
                if(!result.contains(i-k+1)){
                    result.add(i-k+1);
                }
            }
        }
        return result;
    }
}
